import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 八·六乙日己卯时断</p><p>六乙日生逢己卯，时居日禄财临好；</p><p>旺通木气贵无疑，酉土辛重亦可恼。</p><p>乙日己卯时，禄入庙堂，乙木逢卯建禄，为人秀丽，通木火者贵。</p><p>见庚辛为伤禄破命，患目疾。</p><p>若生巳酉丑月，平常衣禄。</p><p>辰戌丑未，吉。</p><p>申月亦吉。</p><p>乙丑日己卯时高，中年大福。</p><p>春生，身太旺，孤。</p><p>夏贫。</p><p>秋有疾。</p><p>冬温厚。</p><p>柱不见辛金，吉。</p><p>若辰戌丑未月，金紫贵。</p><p>乙卯日己卯时高，春生旺，为僧道，富足。</p><p>夏平常，不见辛金，吉。</p><p>秋带疾。</p><p>冬温厚。</p><p>卯丑年月，显达高寿。</p><p>乙巳日己卯时，春孤贫，夏平，秋带疾，冬贵。</p><p>午辰年月、地支一路相连，尤吉。</p><p>乙未日己卯时，年月不见庚辛金，贵。</p><p>秋生，看地厚薄，如生壬戌年月，三四品贵。</p><p>乙酉日己卯时秀，初年破祖，中主发财，未年孤刑。</p><p>乙亥日己卯时，生寅巳月，不见庚辛，日禄归时格，显达清贵。</p><p>纯卯年月，高僧羽士。</p><p>戌，特达聪明，有财禄。</p><p>日禄居时格不同，食神则马要相逢；伤官印运皆为吉，官不逢兮禄自丰。</p><p>乙日时临己卯，偏财时禄归迎。</p><p>辛金酉字不相刑，虎榜定标名姓。</p><p>父母六亲难靠，雁行各自飞腾，文章光耀有才能，无破无冲贵命。</p>",32),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","183卷 八·六乙日己卯时断.html.vue"]]);export{f as default};
